1.SELECT r.area_name,CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION) AS rate FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY rate DESC LIMIT 1;
2.SELECT t.name,AVG(h.all_women_15_49_who_are_anaemic22_) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name;
3.SELECT r.area_name,CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION) FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION) ASC LIMIT 5;
4.SELECT t.name,AVG(CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name;
5.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' AND h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ > h.children_prevalence_of_symptoms_of_acute_respiratory_infecti;
6.SELECT r.area_name,ABS(h.all_women_15_49_who_are_anaemic22_ - CAST(h.men_age_1549_years_who_are_anaemic_130_gdl22_ AS DOUBLE PRECISION)) AS gap FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY gap DESC LIMIT 1;
7.SELECT r.area_name,h.women_age_3049_years_ever_undergone_a_screening_test_for_cer FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.women_age_3049_years_ever_undergone_a_screening_test_for_cer AS DOUBLE PRECISION) DESC LIMIT 3;
8.SELECT t.name,AVG(h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name;
9.SELECT r.area_name,h.children_age_1223_months_fully_vaccinated_based_on_informati FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION) ASC LIMIT 1;
10.SELECT r.area_name,(h.women_age_15_years_and_above_wih_elevated_blood_pressure_systo+h.men_age_15_years_and_above_wih_elevated_blood_pressure_systo) AS total FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY total DESC LIMIT 1;
11.SELECT h.women_age_15_years_and_above_wih_elevated_blood_pressure_systo+h.men_age_15_years_and_above_wih_elevated_blood_pressure_systo FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Uttar Pradesh' AND t.name='Rural';
