13.SELECT h.children_age_1223_months_fully_vaccinated_based_on_informati FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Maharashtra' AND t.name='Urban';
14.SELECT h.children_prevalence_of_symptoms_of_acute_respiratory_infecti FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Andhra Pradesh' AND t.name='Rural';
15.SELECT h.infant_mortality_rate_per_1000_live_births FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Madhya Pradesh' AND t.name='Rural';
16.SELECT h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Rajasthan' AND t.name='Urban';
17.SELECT h.children_age_1223_months_who_received_most_of_their_vaccinat FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Odisha' AND t.name='Rural';
18.SELECT h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Punjab' AND t.name='Total';
19.SELECT h.institutional_births_in_the_5_years_before_the_survey_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Gujarat' AND t.name='Urban';
20.SELECT h.children_under_5_years_who_are_underweight_weightforage18_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Bihar' AND t.name='Total';
21.SELECT h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Kerala' AND t.name='Total';
22.SELECT t.name,AVG(h.men_age_15_years_and_above_wih_elevated_blood_pressure_systo+h.women_age_15_years_and_above_wih_elevated_blood_pressure_systo) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id WHERE h.state=(SELECT state FROM regions WHERE area_name='Tamil Nadu') GROUP BY t.name;
23.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION) DESC LIMIT 1;
24.SELECT h.all_women_15_49_who_are_anaemic22_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Maharashtra' AND t.name='Total';
25.SELECT r.area_name,h.children_under_5_years_who_are_underweight_weightforage18_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.children_under_5_years_who_are_underweight_weightforage18_ AS DOUBLE PRECISION) DESC;
26.SELECT h.children_age_1223_months_fully_vaccinated_based_on_informati FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Bihar' AND t.name='Rural';
27.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.institutional_births_in_the_5_years_before_the_survey_ AS DOUBLE PRECISION) DESC LIMIT 1;
28.SELECT h.children_prevalence_of_symptoms_of_acute_respiratory_infecti FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE r.area_name='Delhi' AND t.name='Urban';
29.SELECT t.name,AVG(h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name;
30.SELECT r.area_name,h.women_age_3049_years_ever_undergone_a_screening_test_for_cer FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.women_age_3049_years_ever_undergone_a_screening_test_for_cer AS DOUBLE PRECISION) DESC LIMIT 3;
31.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.children_age_1223_months_who_received_most_of_their_vaccinat AS DOUBLE PRECISION) < CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION);
32.SELECT r.area_name,(CAST(h.all_women_15_49_who_are_anaemic22_ AS DOUBLE PRECISION)/NULLIF(CAST(h.all_women_15_49_who_are_anaemic22_+h.men_age_1549_years_who_are_anaemic_130_gdl22_ AS DOUBLE PRECISION),0)) AS share FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY share DESC LIMIT 1;
33.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.children_prevalence_of_symptoms_of_acute_respiratory_infecti AS DOUBLE PRECISION) < CAST(h.women_age_3049_years_ever_undergone_a_screening_test_for_cer AS DOUBLE PRECISION);
34.SELECT r.area_name,ABS(MAX(CASE WHEN t.name='Urban' THEN CAST(h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_ AS DOUBLE PRECISION) END)-MAX(CASE WHEN t.name='Rural' THEN CAST(h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_ AS DOUBLE PRECISION) END)) AS gap FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id GROUP BY r.area_name ORDER BY gap DESC LIMIT 1;
35.SELECT t.name,AVG(h.children_age_1223_months_who_received_most_of_their_vaccinat) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name ORDER BY AVG(h.children_age_1223_months_who_received_most_of_their_vaccinat) ASC;
36.SELECT r.area_name,h.institutional_births_in_the_5_years_before_the_survey_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.institutional_births_in_the_5_years_before_the_survey_ AS DOUBLE PRECISION) DESC LIMIT 5;
37.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE (h.men_age_15_years_and_above_wih_elevated_blood_pressure_systo+h.women_age_15_years_and_above_wih_elevated_blood_pressure_systo)>(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_) AND t.name='Total';
38.SELECT r.area_name,h.children_under_5_years_who_are_underweight_weightforage18_ FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.children_under_5_years_who_are_underweight_weightforage18_ AS DOUBLE PRECISION) ASC LIMIT 1;
39.SELECT r.area_name,ABS(h.children_age_1223_months_fully_vaccinated_based_on_informati-h.children_age_1223_months_who_received_most_of_their_vaccinat) AS gap FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY gap DESC LIMIT 1;
40.SELECT r.area_name,(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_elevated_blood_pressure_systo+h.women_age_15_years_and_above_wih_elevated_blood_pressure_systo) AS burden FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY burden DESC LIMIT 1;
41.SELECT r.area_name,((h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_)/NULLIF(h.total_population,0)) AS share FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY share DESC LIMIT 1;
42.SELECT t.name,AVG(h.infant_mortality_rate_per_1000_live_births) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name;
43.SELECT r.area_name,(100-CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)) AS survival FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY survival DESC LIMIT 1;
44.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id GROUP BY r.area_name HAVING MAX(CASE WHEN t.name='Rural' THEN CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION) END)>MAX(CASE WHEN t.name='Urban' THEN CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION) END);
45.SELECT r.area_name,h.senior_citizens_60_years_and_above_with_any_chronic_illness FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY CAST(h.senior_citizens_60_years_and_above_with_any_chronic_illness AS DOUBLE PRECISION) DESC LIMIT 5;
46.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE (h.all_women_15_49_who_are_anaemic22_+h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_)>(h.men_age_1549_years_who_are_anaemic_130_gdl22_+h.men_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_) AND t.name='Total';
47.SELECT r.area_name,(CAST(h.children_under_5_years_who_are_underweight_weightforage18_ AS DOUBLE PRECISION)/NULLIF(h.children_under_5_population,0)) AS rate FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY rate ASC LIMIT 1;
48.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE (h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_)>h.children_age_1223_months_fully_vaccinated_based_on_informati AND t.name='Total';
49.SELECT t.name,AVG(h.children_under_5_years_who_are_underweight_weightforage18_) FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id GROUP BY t.name;
50.SELECT r.area_name,(h.live_births-h.infant_deaths) AS gap FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY gap DESC LIMIT 1;
51.SELECT r.area_name,(h.all_women_15_49_who_are_anaemic22_+h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_) AS female_burden FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY female_burden DESC LIMIT 1;
52.SELECT r.area_name,(CAST(h.children_prevalence_of_symptoms_of_acute_respiratory_infecti AS DOUBLE PRECISION)/NULLIF(h.total_population,0)) AS rate FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY rate ASC LIMIT 1;
53.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.children_age_1223_months_who_received_most_of_their_vaccinat AS DOUBLE PRECISION) > CAST(h.children_under_5_years_who_are_underweight_weightforage18_ AS DOUBLE PRECISION);
54.SELECT r.area_name,ABS(h.all_women_15_49_who_are_anaemic22_-h.men_age_1549_years_who_are_anaemic_130_gdl22_) AS balance FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY balance ASC LIMIT 1;
55.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id GROUP BY r.area_name HAVING MAX(CASE WHEN t.name='Urban' THEN h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_ END)>MAX(CASE WHEN t.name='Rural' THEN h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_ END);
56.SELECT r.area_name,(100-CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)) AS newborn_survival FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY newborn_survival DESC LIMIT 1;
57.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.institutional_births_in_the_5_years_before_the_survey_ AS DOUBLE PRECISION)>90 AND t.name='Total';
58.SELECT r.area_name,(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_) AS load FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY load ASC LIMIT 1;
59.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.children_under_5_years_who_are_underweight_weightforage18_ AS DOUBLE PRECISION) < CAST(h.senior_citizens_60_years_and_above_with_any_chronic_illness AS DOUBLE PRECISION);
60.SELECT r.area_name,ABS(MAX(CASE WHEN t.name='Urban' THEN h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ END)-MAX(CASE WHEN t.name='Rural' THEN h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ END)) AS diff FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id GROUP BY r.area_name ORDER BY diff ASC LIMIT 1;
61.SELECT r.area_name,(h.children_age_1223_months_who_received_most_of_their_vaccinat+h.children_under_5_years_who_are_underweight_weightforage18_) AS risk FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY risk DESC LIMIT 1;
62.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE (h.total_population-(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_))>(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_) AND t.name='Total';
63.SELECT r.area_name,h.children_age_1223_months_fully_vaccinated_based_on_informati FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION)>95 AND t.name='Total';
64.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_>h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_ AND t.name='Total';
65.SELECT r.area_name,(CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)/1000) AS ratio FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY ratio ASC LIMIT 1;
66.SELECT CASE WHEN SUM(h.all_women_15_49_who_are_anaemic22_+h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_)>SUM(h.men_age_1549_years_who_are_anaemic_130_gdl22_+h.men_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_) THEN 'Women' ELSE 'Men' END FROM healthcare_stats h JOIN tru t ON h.tru_id=t.id WHERE t.name='Total';
67.SELECT r.area_name,(h.total_population-(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_)) AS healthy FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY healthy ASC LIMIT 1;
68.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id GROUP BY r.area_name HAVING SUM(CASE WHEN t.name='Rural' THEN h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ END)>SUM(CASE WHEN t.name='Urban' THEN h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ END);
69.SELECT r.area_name,(CAST(h.senior_citizens_60_years_and_above_with_any_chronic_illness AS DOUBLE PRECISION)/NULLIF(h.senior_population,0)) AS rate FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY rate ASC LIMIT 1;
70.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.institutional_births_in_the_5_years_before_the_survey_ AS DOUBLE PRECISION) < CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION) AND t.name='Total';
71.SELECT r.area_name,(CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION)-(CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION))) AS score FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY score DESC LIMIT 1;
72.SELECT r.area_name,((h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_)*1000/NULLIF(h.total_population,0)) AS density FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY density DESC LIMIT 1;
73.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE CAST(h.institutional_births_in_the_5_years_before_the_survey_ AS DOUBLE PRECISION) < CAST(h.children_under_5_years_who_are_underweight_weightforage18_ AS DOUBLE PRECISION) AND t.name='Total';
74.SELECT r.area_name,ABS((h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_)-(h.men_age_15_years_and_above_wih_high_or_very_high_140_mgdl_+h.men_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_)) AS imbalance FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY imbalance DESC LIMIT 1;
