145.SELECT r.area_name,(CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION)-(CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)+CAST(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_ AS DOUBLE PRECISION)/NULLIF(h.total_population,0))) AS performance FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY performance DESC LIMIT 1;
146.SELECT r.area_name,(CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)+CAST(h.institutional_births_in_the_5_years_before_the_survey_ AS DOUBLE PRECISION))/NULLIF(h.live_births,1) AS stress FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY stress ASC LIMIT 1;
147.SELECT r.area_name FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE h.children_age_1223_months_fully_vaccinated_based_on_informati>90 AND h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_>300000 AND t.name='Total';
148.SELECT r.area_name,((CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION)-CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION))*100/NULLIF(h.total_population,0)) AS efficiency FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY efficiency DESC LIMIT 1;
149.SELECT r.area_name,ABS(h.children_under_5_years_who_are_underweight_weightforage18_-h.senior_citizens_60_years_and_above_with_any_chronic_illness)+ABS(h.women_age_15_years_and_above_wih_high_or_very_high_140_mgdl_-h.women_age_1549_years_who_are_overweight_or_obese_bmi_250_kgm2_) AS inequality FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY inequality ASC LIMIT 1;
150.SELECT r.area_name,(CAST(h.children_age_1223_months_fully_vaccinated_based_on_informati AS DOUBLE PRECISION)-(CAST(h.infant_mortality_rate_per_1000_live_births AS DOUBLE PRECISION)))/NULLIF(h.total_population,0) AS sustainability FROM healthcare_stats h JOIN regions r ON h.state=r.state JOIN tru t ON h.tru_id=t.id WHERE t.name='Total' ORDER BY sustainability DESC LIMIT 1;
